import React, {useEffect, useState} from 'react';
import {BrowserRouter as Router, Route, Switch, useHistory, withRouter} from 'react-router-dom';

//components 
import PneuAuto from './screens/PneuAuto'
import Promo from './screens/Promos'
import PneuAgro from './screens/PneuAgro'
import PneuMoto from './screens/PneuMoto'
import PneuPL from './screens/PneuPoidsLourd'
import Footer from './components/Footer'
import SearchResult from './components/SearchResult'
import SearchResultPL from './screens/SearchResultPL'
import DetailsPneu from './screens/DetailsPneu'

function App() {
  const [navigation, setNavigation] = useState('/')
    useEffect(() => {
        console.log(navigation)
      }, []);
  return (
    <React.Fragment>
      <Router basename='/'>
        <Switch>
          <Route exact path='/' component={props => <PneuAuto setNavigation={setNavigation}/>}/>
          <Route path='/pneu-moto' component={props => <PneuMoto setNavigation={setNavigation}/>}/>
          <Route path='/pneu-poids-lourds' component={props => <PneuPL setNavigation={setNavigation}/>}/>
          <Route path='/pneu-agro' component={props => <PneuAgro setNavigation={setNavigation}/>}/>
          <Route path='/pneu-genie-civile' component={props => <PneuAgro setNavigation={setNavigation}/>}/>
          <Route path='/promos' component={props => <Promo setNavigation={setNavigation}/>}/>
          <Route path='/details/pneu/:id_pneu/:designation' component={props => <DetailsPneu />}/>
          <Route path='/selection/pneus-auto/largeur=:largeur/hauteur=:hauteur/diametre=:diametre/charge=:charge/vitesse=:vitesse/marque=:marque' component={props => <SearchResult />}/>
          <Route path='/selection/pneus-poids-lourd/largeur=:largeur/hauteur=:hauteur/diametre=:diametre/type=:type/position=:position/marque=:marque' component={props => <SearchResultPL />}/>
        </Switch>
        <Footer/>
      </Router>
    </React.Fragment>
  );
}

export default App;
